import React from "react";
import "./styles.css"

function DynamicSheets (){
  return (
  <section className = "dynamic-sheets">
    <div className="sheets-top"></div>
    <div className="sheets-content">
      <h1>Title</h1>
      <p>Content</p>
      <p>Total</p>
    </div>
  </section>)
}


function App() {
  return (
    <div className="dynamic-container">
      <DynamicSheets/>
      {/* <DynamicSheets/>
      <DynamicSheets/> */}
    </div>
  );
}

export default App;
